pragma solidity ^0.8.0;
import "./Tokens.sol";
import "../UIntConverter.sol";
import "../Keccak/KeccakInverter.sol";


abstract contract Currencer  is Tokens {


    function exists(bytes32 k_) public view virtual returns (bool);
    function AddressUInt256(address addr_, uint256 v_)
        public virtual
        returns (bytes32 k_);
    function resolveAddressUInt256(bytes32 k_)
        public
        view virtual
        returns (address addr_, uint256 v_);

    function currency(address addr_, uint256 id_)
        public
        returns (bytes32 k_)
    {
        if (addr_==address(0)&&id_==0)
            return Token.CURRENCY;
        token(addr_, id_);
        return AddressUInt256(addr_, id_);
    }

    function roCurrency(address addr_, uint256 id_)
        public
        view
        returns (bytes32 k_)
    {
        k_ = pureCurrency(addr_, id_);
        require(exists(k_), "Currency not registered");
    }
    function pureCurrency(address addr_, uint256 id_)
        public
        pure
        returns (bytes32 k_)
    {
        if (addr_==address(0)&&id_==0)
            return Token.CURRENCY;
        k_ = BytesAndKeccakLib.pureAddressUInt256(addr_, id_);
    }
    function existsCurrency(bytes32 tokenhash_)
        public
        view
        returns (bool)
    {
        if (tokenhash_==Token.CURRENCY)
            return true;
        return exists(tokenhash_);
    }

    function resolveCurrency(bytes32 tokenhash_)
        public
        view
        returns (address addr, uint256 id)
    {
        if (tokenhash_==Token.CURRENCY)
            return (address(0),0);
        require(exists(tokenhash_), "Currency not registered");
        return resolveAddressUInt256(tokenhash_);
    }
    function resolveCurrencyAddr(bytes32 tokenhash_)
        public
        view
        returns (address)
    {
        if (tokenhash_==Token.CURRENCY)
            return address(0);
        require(exists(tokenhash_), "Currency not registered");
        (address addr, )=  resolveAddressUInt256(tokenhash_);
        return addr;
    }


    function granularity(address token_, uint256 tokenId_)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return Tokens.granularity(token_, tokenId_);
    }

    function tokenInfo(bytes32 tokenhash_)
        public
        view
        virtual
        returns (Token.Info memory)
    {
        if (tokenhash_ == Token.CURRENCY)
            return Tokens.tokenInfo(address(0), 0);
        if (!existsCurrency(tokenhash_)) return Token.Info(-18, false, 0);
        (address token, uint256 tokenId) = resolveCurrency(tokenhash_);
        return Tokens.tokenInfo(token, tokenId);
    }

    function features(bytes32 tokenhash_) public view virtual returns (uint64) {
        if (tokenhash_ == Token.CURRENCY) return Tokens.features(address(0), 0);
        if (!existsCurrency(tokenhash_)) return 0;
        (address token, uint256 tokenId) = resolveCurrency(tokenhash_);
        return Tokens.features(token, tokenId);
    }
    function hasFeature(bytes32 tokenhash_,uint64 feature_) public view virtual returns (bool) {
        return features(tokenhash_) & feature_ !=0;
    }
    function isFeatureType(bytes32 tokenhash_,uint64 type_) public view virtual returns (bool) {
        return features(tokenhash_)& Token.TypeMask == type_;
    }
    function supportsInterface(bytes32 tokenhash_,bytes4 interfaceId) public view virtual returns (bool) {
        if (!hasFeature(tokenhash_,Token.SupportERC165)) return false;
        return IERC165(resolveCurrencyAddr(tokenhash_)).supportsInterface(interfaceId);
    }

    function nft(bytes32 tokenhash_) public view virtual returns (bool) {
        if (tokenhash_ == Token.CURRENCY) return Tokens.nft(address(0), 0);
        if (!existsCurrency(tokenhash_)) return false;
        (address token, uint256 tokenId) = resolveCurrency(tokenhash_);
        return Tokens.nft(token, tokenId);
    }

    function granularity(bytes32 tokenhash_)
        public
        view
        virtual
        returns (uint256)
    {
        if (tokenhash_ == Token.CURRENCY) return granularity(address(0), 0);
        if (!existsCurrency(tokenhash_)) return 1;
        (address token, uint256 tokenId) = resolveCurrency(tokenhash_);
        return granularity(token, tokenId);
    }

    function image(bytes32 tokenhash_)
        public
        view
        virtual
        returns (string memory)
    {
        if (tokenhash_ == Token.CURRENCY) return Tokens.image(address(0), 0);
        if (!existsCurrency(tokenhash_)) return Tokens._defaultimage;
        (address token, uint256 tokenId) = resolveCurrency(tokenhash_);
        return Tokens.image(token, tokenId);
    }

}
